B.GI=A.b(s(["\uad50\ud68c\ub294 \uc0ac\ub77c\uc838\uc57c \ud55c\ub2e4.","\uc885\uad50\ub294 \uc4f8\ubaa8\uac00 \uc5c6\ub2e4.","\uc2e0\uc559\uc744 \uac00\uc9c0\ub294 \uac83\uc740 \ubb34\uac00\uce58\ud558\ub2e4.","\uad50\ud68c\ub294 \uc0ac\ud68c\uc0dd\ud65c\uc5d0 \ub3c4\uc6c0\uc744 \uc8fc\uc9c0 \uc54a\ub294\ub2e4.","\uc608\ubc30\ub294 \uc77c\uc694\uc77c\uc5d0\ub9cc \ub4dc\ub9ac\uba74 \ub41c\ub2e4.","\uc131\uacbd\uc744 \uc77d\uc5b4\uc11c \ub3c4\uc6c0\uc774 \ub418\ub294 \uac83\uc740 \uc5c6\ub2e4.","\uc131\uacbd\uc740 \ubb34\uc775\ud558\ub2e4.","\ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc774 \uc65c \uad50\ud68c\uc5d0 \ub2e4\ub2c8\ub294\uc9c0 \ubaa8\ub974\uaca0\ub2e4.","\uad50\ud68c\uc5d0 \ub2e4\ub140\uc11c \ub0b4\uac00 \ud558\uace0 \uc2f6\uc740 \uac83\uc744 \ud558\uc9c0 \ubabb\ud55c\ub2e4.","\uc608\ubc30\ub294 \uc2dc\ub300\ucc29\uc624\uc801\uc774\ub2e4.","\uc885\uad50\ub97c \uac00\uc9c0\ub294 \uac83\uc740 \uc758\ubbf8\uac00 \uc5c6\ub2e4.","\uc2e0\uc559\uc0dd\ud65c\uc774 \uc5b4\ub5a4 \uc810\uc774 \uc720\uc775\ud55c\uc9c0 \ubaa8\ub974\uaca0\ub2e4","\uc131\uacbd\uc740 \ub09c\ud574\ud558\ub2e4","\uad50\ud68c\ub294 \ub098\uc5d0\uac8c \uad00\uc2ec\uc774 \uc5c6\ub2e4.","\uc131\uacbd\uc740 \uc2dc\ub300\ucc29\uc624\uc801\uc774\ub2e4.","\uc0ac\uba85\uac10\uc740 \uc790\uae30\uc758 \ubc1c\uc0c1\uc774\ub2e4.","\ud558\ub098\ub2d8\uc740 \ub098\uc5d0\uac8c \uad00\uc2ec\uc774 \uc5c6\uc73c\uc2dc\ub2e4.","\uad50\ud68c\uc5d0\uc11c \uc9c4\ud589\ub418\ub294 \uc9d1\ud68c\ub294 \ubb34\uac00\uce58\ud558\ub2e4.","\uad50\ud68c\uc5d0 \ub2e4\ub2c8\ub294 \uac83\uc740 \uc2dc\uac04\ub0ad\ube44\ub2e4.","\ub098\ub294 \uad6c\uc6d0\uc5d0 \ub300\ud574 \uad00\uc2ec\uc774 \uc5c6\ub2e4.","\uc124\uad50\ub294 \uc601\uc591\uac00\uac00 \uc5c6\ub2e4.","\uc131\uacbd\uc5d0 \uc911\uc694\ud558\uace0 \ud2b9\ubcc4\ud55c \ub0b4\uc6a9\uc740 \uc5c6\ub2e4.","\uc131\uacbd\uc744 \uc77d\uc744 \uc2dc\uac04\uc5d0 \uc2a4\ud399\uc744 \uc313\uc544\uc57c \ud55c\ub2e4.","\uad50\ud68c\ub294 \ub098\uc5d0\uac8c \ub3c4\uc6c0\uc744 \uc8fc\uc9c0 \ubabb\ud55c\ub2e4.","\ubaa8\ub4e0 \uc885\ub958\uc758 \uc2e0\uc559\uc740 \ubbf8\uc2e0\uc774\ub2e4.","\uc2e0\uc559\uc744 \uc9c0\ud0a4\ub294 \uac83 \ubcf4\ub2e4 \uc798 \uc0b4\uc544\uac00\ub294 \uac83\uc774 \ub354 \uc911\uc694\ud558\ub2e4","\uc77c\uc694\uc77c\uc5d0 \ub2a6\uc7a0\uc744 \uc790\uba74 \uad50\ud68c\uc5d0 \uac00\uc9c0 \uc54a\ub294\ub2e4.","\ub098\ub294 \uc2e0\uc774 \uc2dc\ud0a4\ub294 \ub300\ub85c \uc0b4\uc544\uac08 \uc0dd\uac01\uc774 \uc5c6\ub2e4.","\ub098\uc5d0\uac8c \uc2e0\uc559\uc740 \ubd80\ucc28\uc801\uc778 \uac83\uc774\ub2e4.","\uc131\uacbd\uc740 \uc5b4\ub835\ub2e4.","\uad50\ud68c\uc5d0 \ub2e4\ub2c8\ub294 \uac83\uc774 \ubd80\ub2f4\uc2a4\ub7fd\ub2e4.","\ud604\uc0dd\uc744 \uc990\uae30\ub294 \uac83\uc774 \uc778\uac04\uc758 \ubaa9\uc801\uc774\ub2e4","\ud55c\uad6d\uad50\ud68c\ub294 \ub300\uccb4\ub85c \ud0d0\uc695\uc2a4\ub7ec\uc6b4 \uac1c\uc778\uc5d0 \uc758\ud574 \ud5cc\uae08\uc744 \ubaa9\uc801\uc73c\ub85c \uc6b4\uc601\ub41c\ub2e4.","\uc2e0\uc559\ubcf4\ub2e4 \ub0b4 \uc778\uc0dd\uc774 \ub354 \uc911\uc694\ud558\ub2e4.","\uc608\ubc30\ub97c \ub4dc\ub824\uc57c \ud55c\ub2e4\ub294 \uc758\ubb34\uac10\uc774 \uc788\ub2e4.","\uad50\ud68c\uc5d0 \ub098\uac08 \ud544\uc694\uac00 \uc5c6\ub2e4.","\uad11\uc2e0\uc740 \uc758\ubbf8\uac00 \uc5c6\ub2e4.","\uacbd\uac74\uc0dd\ud65c\uc5d0 \uae30\ub300\uae30\ubcf4\ub2e4 \uc758\ubbf8\uc788\ub294 \uc0b6\uc744 \uc0b4\uc544\uc57c \ud55c\ub2e4.","\ub9f9\ubaa9\uc801\uc778 \uc2e0\uc559\uc744 \uac00\uc9c0\ub294 \uac83 \ubcf4\ub2e4 \ub098\uc740 \uc0b6\uc744 \ucd94\uad6c\ud560 \uac83\uc774\ub2e4."]),t.s)
B.HB=A.b(s(["\ud655\uc2e0\uc5d0 \ucc2c \uc2e0\uc559\uc774 \uac74\uac15\ud558\ub2e4.","\uacbd\uac74\ud558\uac8c \uc0ac\ub294 \uc0b6\uc774 \uc758\ubbf8\uac00 \uc788\ub2e4.","\uad50\ud68c\uc5d0 \uac00\ub294 \uac83\uc774 \ubcf4\ub78c\ucc28\ub2e4.","\uc608\ubc30\ub97c \ub4dc\ub9ac\ub294 \uac83\uc774 \ubcf4\ub78c\ucc28\ub2e4.","\uc778\uc0dd\uc5d0\uc11c \uc911\uc694\ud55c \uac83\uc740 \uc2e0\uc559\uc744 \uc9c0\ud0a4\ub294 \uac83\uc774\ub2e4.","\uad50\ud68c\ub294 \uac70\ub8e9\ud558\ub2e4.","\uc131\uacbd\uc740 \uc720\uc775\ud558\ub2e4","\uad50\ud68c\uc5d0\uc11c \uc9c4\ud589\ub418\ub294 \uc9d1\ud68c\ub294 \uc720\uc775\ud558\ub2e4.","\ub098\ub294 \uc2e0\uc559\uc744 \uc9c0\ud0a4\uae30 \uc704\ud574 \uc0b4\uc544\uac04\ub2e4.","\ud558\ub098\ub2d8\uc740 \ub098\uc640 \ud568\uaed8 \ud558\uc2e0\ub2e4","\ub098\ub294 \uad6c\uc6d0\ubc1b\uc558\ub2e4."]),t.s)
B.Hb=A.b(s(["\ub098\ub294 \uc131\uacbd\uc758 \ubaa8\ub4e0 \ube44\ubc00\uc744 \uc54c\uace0 \uc788\ub2e4.","\ud558\ub098\ub2d8\uc740 \uc9c4\ub9ac\ub97c \uc54c\uace0 \uc788\ub294 \uc0ac\ub78c\ub4e4\ub9cc \uad6c\uc6d0\ud558\uc2e0\ub2e4.","\uc9c4\ub9ac\ub294 \ud558\ub098\ub2d8\uacfc \ud2b9\ubcc4\ud55c \uad00\uacc4\ub97c \ub9fa\uc740 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc218\uc5ec\ub418\ub294 \ud2b9\uad8c\uc774\ub2e4","\ub098\ub294 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc9c4\ub9ac\ub97c \uac00\ub974\uce60 \uc218 \uc788\ub2e4.","\ub300\ub2e4\uc218\uc758 \ubaa9\uc0ac\ub098 \uc2e0\uc559\uc778\ub4e4\uc740 \uc9c4\ub9ac\uc5d0 \uad00\uc2ec\uc774 \uc5c6\ub2e4.","\ub098\ub294 666\uc758 \ube44\ubc00\uc744 \uc54c\uace0 \uc788\ub2e4.","\ub098\ub294 \uc801\uadf8\ub9ac\uc2a4\ub3c4\uac00 \uc5b4\ub5a4 \uc874\uc7ac\uc778\uc9c0 \uc54c\uace0 \uc788\ub2e4.","\uc131\uacbd\uc740 \ucd5c\ud6c4\uc758 \uc2ec\ud310 \ub54c \uc9c4\ub9ac\ub97c \uc544\ub294 \uc0ac\ub78c\ub4e4\uc744 \ud734\uac70\uc2dc\ucf1c \ubcf4\ud638\ud558\uc2e4 \uac83\uc774\ub77c\uace0 \ub9d0\ud558\uace0 \uc788\ub2e4.","\ub098\ub294 \uc62c\ubc14\ub978 \uc2e0\ud559\uad00\uc744 \uac00\uc9c0\uace0 \uc788\ub294 \uc2e0\uc559\uc758 \uc9c0\ub3c4\uc790\ub97c \ub9cc\ub0ac\ub2e4.","\uc9c4\ub9ac\ub294 \uc228\uaca8\uc838 \uc788\ub2e4","\ub098\ub294 \uc62c\ubc14\ub978 \uc2e0\ud559\uad00\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4.","\uc8fc\ub958 \uad50\ud68c\ub294 \uc9c4\ub9ac\ub97c \ubaa8\ub978\ub2e4.","\uc9c4\ub9ac\ub97c \uc54c\uace0 \uc788\ub294 \uc0ac\ub78c\uc774 \ud558\ub098\ub2d8\uacfc \uad50\uc81c\ud558\ub294 \uc0ac\ub78c\ub4e4\uc774\ub2e4.","\uc138\uacc4\ub294 \uc0ac\ud0c4\uc5d0 \uc18d\ud574\uc788\ub2e4.","\uc9c4\ub9ac\uc5d0\uc11c \ubc97\uc5b4\ub09c \ub300\ubd80\ubd84\uc758 \uad50\ud68c\ub294 \uad6c\uc6d0\uc5d0 \uc774\ub974\uc9c0 \ubabb\ud55c\ub2e4","\ub300\ubd80\ubd84\uc758 \uad50\ud68c\ub294 \ud558\ub098\ub2d8\uaed8\uc11c \ubb34\uc5c7\uc744 \uc6d0\ud558\uc2dc\ub294\uc9c0 \uad00\uc2ec\uc774 \uc5c6\ub2e4.","\ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \uc9c4\ub9ac\ub97c \ubaa8\ub978\ub2e4","\ub9ce\uc740 \uad50\ud68c\ub294 \uc9c4\ub9ac\uc5d0\uc11c \ubc97\uc5b4\ub098 \uc788\ub2e4","\uc774\uc2a4\ub77c\uc5d8\uc5d0 \uc120\uad50\ud558\ub294 \uac83\uc774 \uc911\uc694\ud55c \ubaa9\ud45c\ub2e4.","\uc9c4\ud654\ub860\uc740 \ud5c8\uad6c\ub2e4."]),t.s)
B.H7=A.b(s(["\uc9c4\ud654\ub860\uc740 \ud604\uc2e4\uc774\ub2e4.","\uc9d0\uc2b9\uc758 \ud45c\ub098 666\uacfc \uac19\uc740 \uc694\uc18c\ub294 \ub2e8\uc9c0 \uc0c1\uc9d5\uc774\ub098 \ud5c8\uc6b8\uc5d0 \ubd88\uacfc\ud55c \uac1c\ub150\uc774\ub2e4.","\uc694\ud55c\uacc4\uc2dc\ub85d\uc740 \ud604\uc2e4\uacfc \ub3d9\ub5a8\uc5b4\uc838 \uc788\ub2e4.","\ubaa8\ub4e0 \uc0ac\ub78c\uc774 \ub098\ub984\ub300\ub85c \uc131\uacbd\uc758 \uc9c4\ub9ac\ub97c \uc54c \uc218 \uc788\ub2e4.","\ub098\ub294 \ud3c9\ubc94\ud55c \uc2e0\uc559\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4."]),t.s)
